import { createMuiTheme } from '@material-ui/core/styles';

const overrides = {
  MuiTab: {
    // general overrides for your material tab component here
    root: {
      backgroundColor: 'red',
      '&$selected': {
        backgroundColor: 'blue',
      }
    },
  },
};

export default createMuiTheme( {
  overrides,
});
